import Header from "./Header";

const Layout = props => (
  <div>
    <Header className="header" />
    <div className="layoutStyle">{props.children}</div>
    <style jsx>
      {`
        .layoutStyle {
          box-sizing: border-box;
          margin: 0;
          padding: 0;
          height: 100%;
          pointer-events: none;
          position: absolute;
          top: 0;
          width: 100%;
        }
      `}
    </style>
  </div>
);

export default Layout;
